import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import Login from "./Components/Login";
import Navbar from "./Components/layout/Navbar";

const App = () => {
  return (
    <Router>
      <div className="App">
        <Navbar />
        My App
      </div>
    </Router>
  );
};

export default App;
